                                <p>{sanatorium.address}</p>
                                {/* {(()=>{
                                
                                    let icons = eval(sanatorium.icons);
                                    console.log(icons)
                                    for(let icon in icons){

                                        if (icons[icon] == true)
                                        {
                                            <img src={'images/cardIcons/' + icon + '.svg'} />
                                        }
                                    };
                                })()} */}
                            </div>



                        );
                    });
                    
                    return sanatoriumsDivs;

                })()}                    
            </div>
        </div>
      
    )
}

export default List
